import { gql } from "apollo-boost";

const getProductsQuery = gql`
  query {
    products {
      id
      model_name
      model_color
      model_category
      createdBy {
        id
      }
    }
  }
`;

const getDealersQuery = gql`
  query {
    dealers {
      name
      age
    }
  }
`;



export { getProductsQuery, getDealersQuery };
